import React, { useState, useEffect } from "react";
import "./MatchingProcessPage.css";

const MatchingProcessPage = () => {
  const [isMatched, setIsMatched] = useState(false);

  useEffect(() => {
    // 여기에서 매칭 상태를 확인하고, 매칭이 완료되면 setIsMatched(true)를 호출하세요.
    // 예를 들어, setTimeout 또는 API 요청을 사용하여 매칭 상태를 확인할 수 있습니다.

    // setTimeout(() => {
    //   setIsMatched(true);
    // }, 5000); // 5초 후에 매칭 완료로 설정 (예시)
  }, []);

  return (
    <div className="matchingprocesspage">
      <div className="div8">운동뭉치</div>
      <div className="div9">메이트 매칭</div>
      <img
        className="matchingprocesspage-child"
        alt=""
        src="/rectangle-1@2x.png"
      />
      <div className="div10">
        <p className="p">{`운동뭉치에서 여러분에게 딱 맞는 `}</p>
        <p className="p">운동 메이트를 찾아보세요!</p>
      </div>
      <img className="matchingprocesspage-item" alt="" src="/rectangle-4.svg" />
      <b className="b2">빠르고 정확한 매칭을 간단하게</b>
      <div className="div11">어렵지 않게 나와 가장 잘 맞는 메이트 찾기</div>
      <img
        className="matchingprocesspage-inner"
        alt=""
        src="/rectangle-18.svg"
      />
      <div className="div12">운동뭉치만의 특별한 서비스를 경험해보세요</div>
      <div className="matchingprocesspage-child1" />
      <div className="div13">자유로운 의견 교환</div>
      <div className="div14">
        활발하게 의견 교환이 이루어지는 게시판을 제공합니다.
      </div>
      <div className="matchingprocesspage-child2" />
      <div className="div15">게시판으로 바로 이동</div>
      <div className="matchingprocesspage-child3" />
      <div className="div16">정확한 매칭률</div>
      <div className="div17">
        <p className="p">{`협업 필터링 알고리즘을 기반으로 `}</p>
        <p className="p">{`더욱 정확한 메이트 매칭 경험을 제공합니다. `}</p>
      </div>
      <div className="matchingprocesspage-child4" />
      <div className="div18">{`빠른 매칭 `}</div>
      <div className="div19">운동 메이트를 빠르고 정확하게 매칭해줍니다.</div>
      <div className="div20">1/3</div>
      <div className="userid">USERID님, 환영합니다!</div>
      {isMatched ? (
        <div className="next-page-button">
          <button onClick={() => window.location.href = "/next-page"}>다음 페이지로 이동</button>
        </div>
      ) : (
        <div className="matching-animation">
          {/* 매칭 진행 중 애니메이션 요소 */}
        </div>
      )}
    </div>
  );
};

export default MatchingProcessPage;
